import React from 'react';
import { Link } from "react-router-dom";
import useMediaQuery from "@material-ul/core/useMediaQuery";

function Nav() {
	const tablet = useMediaQuery("(min-width: 600px")
  return (
    <nav className="Nav">
    	<ul>

    		<Link to="/">
    			<li>HOME</li>
    		</Link>

    		<Link to="/portfolio">
    			<li>PORTFOLIO</li>
    		</Link>

    		<Link to="/contact">
    			<li>CONTACT ME</li>
    		</Link>

    	</ul>
    </nav>
  );
}

export default Nav;
